import "../App.css";
import React,{useState,useEffect} from "react";
import "./Logreg.css";

function Login(){
  function handleChange(evt) {
    setState({ nev: evt.target.value });
    setState({ password: evt.target.value });
  }
    const [data,setData]=useState({
      nev: "",
      password: ""
    })
    const getData=()=>{
    fetch("http://localhost:5000/api/user/letolt",
      { method: "POST",
        headers: {
        "Accept": 'application/json',
        "Content-Type": 'application/json'
        },
      }).then(function(response){
        console.log(response)
        return response.json();
      }).then(function(myJson) {
          console.log(myJson);
          setData(myJson)
      });
    }
      useEffect(()=>{
      getData()
    },[])

    return(
        <form className="page">
          <img id="autolog" src={require("../kepek/log.png")} alt="auto" />
          <div className="reglog1">
            <br /> <br />
            <input type="text" id="un" placeholder="felhasználónév..." onChange={handleChange} value={state.nev} name="nev"/><br /><br />
            <input type="password" id="pwd" placeholder="jelszó..." onChange={handleChange} value={state.password} name="password"/><br /><br />
            <button onClick={(e) => getData()} >Login</button>
          </div>
        </form>
    );
}
export default Login;
